import React from 'react'
import mapa from 'src\Img\Mapa.PNG'


const Kontakt = () => {
  return (
    <div className='main'>
        <div className='left'>

          <img src={mapa} />

        </div>
        <div className='right'></div>
    
    
    </div>
  )
}
export default Kontakt
